import Head from "next/head";
import Link from "next/link";
import { useEffect } from "react";
import axios from "axios";
import cheerio from "cheerio";

const loginHeader = () => {
    useEffect(() => {
        async function getHTML() {
            try {
                return await axios.get("https://maple.gg/u/히그링");
            } catch (error) {
                console.error(error);
            }
        }

        getHTML()
            .then((html) => {
                
                const $ = cheerio.load(html.data);

                let profile = {}
                
                profile.name = $("div#user-profile").find("b.align-middle")[0].children[0].data;
                profile.level = $("div#user-profile").find("ul.user-summary-list")[0].children[1].children[0].data;
                profile.work = $("div#user-profile").find("ul.user-summary-list")[0].children[3].children[0].data
                profile.popularity = $("div#user-profile").find("ul.user-summary-list")[0].children[5].children[2].children[0].data;
                profile.guild = $("div.user-additional").find("a.text-yellow")[0].children[0].data

                let rank = $("div.user-additional").find("div.col-6");
                
                rank.each(i => {
                    console.log(rank[i].children[3].children);
                });
                
                return;
            })
            .then((res) => console.log(res)); // 저장된 결과를 출력
    });

    return (
        <header className="d-flex justify-content-center align-items-center fs-2 text-white">
            <Head>
                <title>msg.gg</title>
                <link rel="stylesheet" href="/style/form.css" />
                <link
                    href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
                    rel="stylesheet"
                ></link>
                <script src="/js/app.js"></script>
            </Head>
            <div className="logo fs-3 font-lighter">
                <a href="#">msg.gg</a>
            </div>
        </header>
    );
};

export default loginHeader;
